import React from "react";
import {TasksList} from "./TasksList";
import {connect} from "react-redux";
import {deleteTaskThunk, getTasksThunk} from "../../store/createTaskReducer";

const TaskListContainer = ({tasks,deleteTaskThunk,getTasksThunk}) => {
    const task = Object.entries(tasks).map(task => task[1])
    console.log('RENDER TASKSLISTCONTAINER')
    return (
        <div>
            <TasksList tasks={task}
                       deleteTaskThunk={deleteTaskThunk}
                       getTasksThunk={getTasksThunk}
            />
        </div>
    )
};

export default connect(null,{deleteTaskThunk,getTasksThunk})(TaskListContainer)
